import React from 'react';
import './Header.css';

function Header() {
  return (
    <div className="App">
      <header>
        <div className="header">
          <form>
            <label>search</label>
            <input type="text"></input>
          </form>
          <ul className="headerList">
            <li id="header_weather">Weather</li>
            <li id="header_news">News</li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default Header;
